import React, { Component } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";

import Login from "./Login";

export default class Desloged extends Component {

  constructor(props) {
    super(props);

  }

  render() {
    return (
      <div className="App">
        <Router>
          <div>
            <Route path="/login" exact component={Login} />
          </div>
        </Router>
      </div>
    );
  }
}
